import React from 'react';
import { connect } from 'react-redux';
import ContactForm from './forms/ContactForm';

class Contact extends React.Component {
  render() {
      return (
        <div>
          <h3>Create a Stream</h3>
          <ContactForm />
        </div>
    )
  }
}


export default connect(null)(Contact);
